import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import Sidebar from './Sidebar';
import './GestionAlojamientosServicios.css';

const GestionAlojamientosServicios = () => {
  const navigate = useNavigate();
  const [alojamientos, setAlojamientos] = useState([]);
  const [servicios, setServicios] = useState([]);
  const [alojamientoSeleccionado, setAlojamientoSeleccionado] = useState(null);
  const [serviciosSeleccionados, setServiciosSeleccionados] = useState([]);

  useEffect(() => {
    fetchAlojamientos();
    fetchServicios();
  }, []);

  const fetchAlojamientos = async () => {
    try {
      const response = await fetch('http://localhost:3001/alojamiento/getAlojamientos');
      const data = await response.json();
      setAlojamientos(data);
    } catch (error) {
      console.error('Error al obtener los alojamientos:', error);
    }
  };

  const fetchServicios = async () => {
    try {
      const response = await fetch('http://localhost:3001/servicio/getAllServicios');
      const data = await response.json();
      setServicios(data);
    } catch (error) {
      console.error('Error al obtener los servicios:', error);
    }
  };

  const handleChangeAlojamiento = (e) => {
    const idAlojamiento = e.target.value;
    setAlojamientoSeleccionado(idAlojamiento);
    fetchAlojamientoServicios(idAlojamiento);
  };

  const handleChangeServicios = (e) => {
    const selectedOptions = Array.from(e.target.selectedOptions).map(option => option.value);
    setServiciosSeleccionados(selectedOptions);
  };

  const fetchAlojamientoServicios = async (idAlojamiento) => {
    try {
      const response = await fetch(`http://localhost:3001/alojamientosServicios/getAlojamientoServicios/${idAlojamiento}`);
      const data = await response.json();
      setServiciosSeleccionados(data.map(servicio => servicio.idServicio.toString()));
    } catch (error) {
      console.error('Error al obtener los servicios del alojamiento:', error);
    }
  };

  const handleSave = async () => {
    if (!alojamientoSeleccionado) return;
    try {
      // Eliminar las relaciones actuales
      await fetch(`http://localhost:3001/alojamientosServicios/deleteAlojamientoServicio/${alojamientoSeleccionado}`, {
        method: 'DELETE',
      });

      // Crear nuevas relaciones
      const promises = serviciosSeleccionados.map(servicioId =>
        fetch('http://localhost:3001/alojamientosServicios/createAlojamientoServicio', {
          method: 'POST',
          headers: { 'Content-Type': 'application/json' },
          body: JSON.stringify({ idAlojamiento: alojamientoSeleccionado, idServicio: servicioId }),
        })
      );

      await Promise.all(promises);
      alert('Servicios actualizados con Ã©xito');
    } catch (error) {
      console.error('Error al guardar los servicios del alojamiento:', error);
    }
  };

  return (
    <div className="dashboard">
      <Sidebar
        role="admin"
        handleRegistrarAlojamientoClick={() => navigate('/registrar-alojamiento')}
        handleAdministrarImagenesClick={() => navigate('/administrador-imagenes')}
        handleCheckInClick={() => navigate('/idw-checkin')}
        handleGestionAlojamientosClick={() => navigate('/gestion-de-alojamientos')}
        handleTipoAlojamientoClick={() => navigate('/gestor-tipo-alojamiento')}
        handleGestionServiciosClick={() => navigate('/gestor-servicios')}
      />
      <main className="main-content">
        <h1>GestiÃ³n de Alojamientos y Servicios</h1>
        <div className="form-container">
          <label>Alojamiento:</label>
          <select onChange={handleChangeAlojamiento} value={alojamientoSeleccionado || ''}>
            <option value="">Seleccione un alojamiento</option>
            {alojamientos.map(alojamiento => (
              <option key={alojamiento.idAlojamiento} value={alojamiento.idAlojamiento}>
                {alojamiento.Titulo}
              </option>
            ))}
          </select>

          {alojamientoSeleccionado && (
            <>
              <label>Servicios:</label>
              <select multiple onChange={handleChangeServicios} value={serviciosSeleccionados}>
                {servicios.map(servicio => (
                  <option key={servicio.idServicio} value={servicio.idServicio}>
                    {servicio.Nombre}
                  </option>
                ))}
              </select>
              <button onClick={handleSave}>Guardar</button>
            </>
          )}
        </div>
      </main>
    </div>
  );
};

export default GestionAlojamientosServicios;
